  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this paper is to expose
  the reader to the various birds nesting on the Malheur environmental field station
  (MEFS). Each species will be discussed briefly as to the stage of development of
  the eggs or young and other points of interest that might prove valuable. This study
  period is more or less a spot check, since all nests were found between June 24
  and July 2 1972.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
